import React from "react";

import classes from "./Header.module.css";
import navClasses from "./Nav.module.css";
import authorClasses from "./Author.module.css";
import copyrightClasses from "./Copyright.module.css";

import Nav from "./Nav";
import Author from "./Author";
import Copyright from "./Copyright";

const Header = () => {
  return (
    <header className={classes.header}>
      <div className={classes["header__inner-header"]}>
        <Author className={authorClasses.author} />
        <Nav />
        <Copyright />
      </div>
    </header>
  );
};

export default Header;
